import React, { Component } from 'react';
import { Card } from 'primereact/card';

class Hlavnicards extends Component {


    render() {
        const { currentDate, summary } = this.props;
        return (

            <div class= "p-col-12">
                <div class= "p-grid">
                <div class="p-col-4" style={{ textAlign: 'center', borderStyle: 'solid' }}>

                <Card title="Infected" subTitle={summary.TotalConfirmed}  >
                        {new Date(currentDate).toDateString()}
                    </Card>

                </div>
                <div class="p-col-4" style={{ textAlign: 'center', borderStyle: 'solid' }}>
                <Card title="Deaths" subTitle={summary.TotalDeaths}  >
                        {new Date(currentDate).toDateString()}
                    </Card>

                </div>
                <div class="p-col-4" style={{ textAlign: 'center', borderStyle: 'solid' }}>

                    <Card title="Recovered" subTitle={summary.TotalRecovered}  >
                        {new Date(currentDate).toDateString()}
                    </Card>
                    </div> 
                </div>
            </div>

        );
    }
}

export default Hlavnicards;
